// LoadHeroSkills allows an eager lookup of values, cached into the
// loaded structs of the objects. This is for a 1-M or N-M relationship.
func (heroL) LoadHeroSkills(ctx context.Context, e boil.ContextExecutor, singular bool, maybeHero interface{}, mods queries.Applicator) error {
	var slice []*Hero
	var object *Hero

	if singular {
		var ok bool
		object, ok = maybeHero.(*Hero)
		if !ok {
			object = new(Hero)
			ok = queries.SetFromEmbeddedStruct(&object, &maybeHero)
			if !ok {
				return errors.New(fmt.Sprintf("failed to set %T from embedded struct %T", object, maybeHero))
			}
		}
	} else {
		s, ok := maybeHero.(*[]*Hero)
		if ok {
			slice = *s
		} else {
			ok = queries.SetFromEmbeddedStruct(&slice, maybeHero)
			if !ok {
				return errors.New(fmt.Sprintf("failed to set %T from embedded struct %T", slice, maybeHero))
			}
		}
	}

	args := make(map[interface{}]struct{})
	if singular {
		if object.R == nil {
			object.R = &heroR{}
		}
		args[object.ID] = struct{}{}
	} else {
		for _, obj := range slice {
			if obj.R == nil {
				obj.R = &heroR{}
			}
			args[obj.ID] = struct{}{}
		}
	}

	if len(args) == 0 {
		return nil
	}

	argsSlice := make([]interface{}, len(args))
	i := 0
	for arg := range args {
		argsSlice[i] = arg
		i++
	}

	query := NewQuery(
		qm.From(`game_runtime.hero_skills`),
		qm.WhereIn(`game_runtime.hero_skills.hero_id in ?`, argsSlice...),
		qmhelper.WhereIsNull(`game_runtime.hero_skills.deleted_at`),
	)
	if mods != nil {
		mods.Apply(query)
	}

	results, err := query.QueryContext(ctx, e)
	if err != nil {
		return errors.Wrap(err, "failed to eager load hero_skills")
	}

	var resultSlice []*HeroSkill
	if err = queries.Bind(results, &resultSlice); err != nil {
		return errors.Wrap(err, "failed to bind eager loaded slice hero_skills")
	}

	if err = results.Close(); err != nil {
		return errors.Wrap(err, "failed to close results in eager load on hero_skills")
	}
	if err = results.Err(); err != nil {
		return errors.Wrap(err, "error occurred during iteration of eager loaded relations for hero_skills")
	}

	if len(heroSkillAfterSelectHooks) != 0 {
		for _, obj := range resultSlice {
			if err := obj.doAfterSelectHooks(ctx, e); err != nil {
				return err
			}
		}
	}
	if singular {
		object.R.HeroSkills = resultSlice
		for _, foreign := range resultSlice {
			if foreign.R == nil {
				foreign.R = &heroSkillR{}
			}
			foreign.R.Hero = object
		}
		return nil
	}

	for _, foreign := range resultSlice {
		for _, local := range slice {
			if local.ID == foreign.HeroID {
				local.R.HeroSkills = append(local.R.HeroSkills, foreign)
				if foreign.R == nil {
					foreign.R = &heroSkillR{}
				}
				foreign.R.Hero = local
				break
			}
		}
	}

	return nil
}

