// of the hero, optionally inserting them as new records.
// Appends related to o.R.HeroSkills.
// Sets related.R.Hero appropriately.
func (o *Hero) AddHeroSkills(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*HeroSkill) error {
	var err error
	for _, rel := range related {
		if insert {
			rel.HeroID = o.ID
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE \"game_runtime\".\"hero_skills\" SET %s WHERE %s",
				strmangle.SetParamNames("\"", "\"", 1, []string{"hero_id"}),
				strmangle.WhereClause("\"", "\"", 2, heroSkillPrimaryKeyColumns),
			)
			values := []interface{}{o.ID, rel.ID}

			if boil.IsDebug(ctx) {
				writer := boil.DebugWriterFrom(ctx)
				fmt.Fprintln(writer, updateQuery)
				fmt.Fprintln(writer, values)
			}
			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			rel.HeroID = o.ID
		}
	}

	if o.R == nil {
		o.R = &heroR{
			HeroSkills: related,
		}
	} else {
		o.R.HeroSkills = append(o.R.HeroSkills, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &heroSkillR{
				Hero: o,
			}
		} else {
			rel.R.Hero = o
		}
	}
	return nil
}

